/**
 * @param {number[]} nums
 * @return {number}
 */
var numberOfGoodPartitions = function(nums) {
    const mod = 1e9 + 7;
    let dp = new Array(nums.length + 1).fill(0);
    dp[0] = 1; // Base case: one way to partition the empty prefix
    let lastOccurrence = new Map();

    for (let i = 1; i <= nums.length; i++) {
        dp[i] = (2 * dp[i - 1]) % mod;
        if (lastOccurrence.has(nums[i - 1])) {
            // Subtract the number of partitions that include previous occurrence of nums[i-1]
            dp[i] = (dp[i] - dp[lastOccurrence.get(nums[i - 1])] + mod) % mod;
        }
        lastOccurrence.set(nums[i - 1], i - 1);
    }

    return dp[nums.length] - 1; // Subtract 1 to exclude the partition of the whole array as a single block
};
